import React from "react";

function MidDesText() {
  return (
    <div className="four-mid-des-text">
      "To take the customer website experience to new heights depends on paying
      attention to visual detail. Navigating through your business site should
      be visually streamlined and simple, while instructional yet beautiful"
    </div>
  );
}

export default MidDesText;
